import React, { Component } from 'react'
import PlaceJson from "../JSON/place.json"

class placeVisited extends Component {
    render() {
        const {places}  = PlaceJson;
        return (
            <div>
                {
                    places.map(place => console.log(place.img))
                }
            </div>
        )
    }
}


export default placeVisited;
